  {
   "cell_type": "markdown",
   "id": "e6284c89",
   "metadata": {},
   "source": [
    "# Creating a text processing pipeline"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 84,
   "id": "4f726f60",
   "metadata": {},
   "outputs": [],
   "source": [
    "# Making a Pipeline\n",
    "pipeline = [str.lower, tokenize, remove_stop]\n",
    "def prepare(text, pipeline):\n",
    "    tokens = text\n",
    "    for fun in pipeline:\n",
    "        tokens = fun(tokens)\n",
    "    return tokens"
   ]
  },
