    "# Importing the 're' module for regular expression operations\n",
    "import re\n",
    "\n",
    "def is_alphabetic(input_string):\n",
    "    # Defining a regular expression pattern to match alphabetic characters only\n",
    "    pattern = r'^[A-Za-z]+$'\n",
    "    return bool(re.match(pattern, input_string))\n",
    "\n",
