    "\n",
    "def is_alphanumeric(input_string):\n",
    "    # Defining a regular expression pattern to match alphanumeric characters\n",
    "    pattern = r'^[a-zA-Z0-9]+$'\n",
    "    return bool(re.match(pattern, input_string))\n",
    "\n",
