    "# Importing the 're' module for regular expression operations\n",
    "import re\n",
    "\n",
    "def is_valid_ip(ip):\n",
    "    # Defining a regular expression pattern to match ip address\n",
    "    pattern = r'^(\\d{1,3}\\.){3}\\d{1,3}$'\n",
    "    return bool(re.match(pattern, ip))\n",
    "\n",
    "# Example usage:\n",
    "ip = \"107.822.0.1\"\n",
    "result = is_valid_ip(ip)\n",
    "print(f\"{ip} is a valid IP address: {result}\")"
